import React from 'react';
import ReactDOM from 'react-dom';

const name="sandeep Choudhary";

const img1="https://picsum.photos/200";

ReactDOM.render(

	<>
	<h1 contentEditable="true">My name is {name}</h1>
	<img src={img1}/>	

	</>


	,document.getElementById("root"));
